	layer[12] = model.hook(Conv2D(8, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_7_w, &conv2d_7_b), layer[9]);
	layer[13] = model.mergex(Concat(-1), 3 ,layer[10] ,layer[11] ,layer[12]);
